import * as React from 'react'
import Head from 'next/head'

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
}

const Shell: React.FC<undefined> = ({ children }) => (
    <div style={layoutStyle}>
        <Head>
            <title>NextJS Template</title>
        </Head>
        {children}
    </div>
)
export default Shell;
